class Solution(object):
    def threeSum(self, nums):
        """
        :type nums: List[int]
        :rtype: List[List[int]]
        """
        nums.sort()
        # print(nums)
        results = list()

        for i in range(len(nums) - 2):
            if i != 0:
                if nums[i-1] == nums[i]:
                    continue
            left = i + 1
            right = len(nums) - 1
            # print(i,left,right)
            while left != right:
                if nums[i] + nums[left] + nums[right] < 0:
                    left += 1
                elif nums[i] + nums[left] + nums[right] > 0:
                    right -= 1
                elif nums[i] + nums[left] + nums[right] == 0:
                    results.append([nums[i],nums[left],nums[right]])
                    left += 1

        print(results)
        re = list()
        for r in results:
            if r not in re:
                re.append(r)

        print(re)
        return re

